import React from 'react';
import './App.css';
import { Home, CreateWodRoute } from './routes';
import {
  BrowserRouter,
  Switch,
  Route
} from "react-router-dom";
import { NotFound, Dashboard } from './components';
function App() {
  return (

      <div>


        <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/create">
            <CreateWodRoute />
          </Route>
          <Route>
            <NotFound />
          </Route>
        </Switch>
      </div>
      );
  }

export default App;
